5	2023-08-11	2023-10-21	Back End dasturlash kurslari	courses/Frame_1_1.png	1	<h3><span style="color:#95a5a6"><strong>Soff Studyda Back End kurslari kimlar uchun:</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">-Back-end sohasiga kirib,barchasini amaliyotda o&#39;rganmoqchi bo&#39;lganlar uchun;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">-Back-end kurslarida: NPM,Git,JavaScript,Node.js,MongoDb,MySQL kabi texnologiyalarni o&#39;rganmoqchi bo&#39;lganlar uchun;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">-0 dan start up ko&#39;tarish,mijoz bilan gaplashish,hamda doimiy mijozlarga ega bo&#39;lish ko&#39;nikmalariga ega bo&#39;lmoqchilar uchun;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">-Ishga kirish uchun suhbatga tayyorlov.(Texnik intervyu),va ishga kirishda so&#39;raladigan portfolio uchun real loyiha qilmoqchi bo&#39;lganlar uchun;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Kursdan keyingi oylik maoshingiz:</strong></span></h3>\r\n\r\n<h4><span style="color:#95a5a6">Back-end mutaxasislarining oylik maosh;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Boshlang&#39;ich</strong></span></h3>\r\n\r\n<h4><span style="color:#95a5a6">200$ dan 400$ gacha</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>1-3 yillik tajriba bilan</strong></span></h3>\r\n\r\n<h4><span style="color:#95a5a6">400$ dan 1200$ gacha</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>3+ tajriba bilan</strong></span></h3>\r\n\r\n<h4><span style="color:#95a5a6">1300$ dan 3000+$ gacha</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#95a5a6">&nbsp; &nbsp; &nbsp;&nbsp;</span><img src="/media/uploads/2023/08/12/image-20230812161953-1.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Kursdan so&#39;ng siz:</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">- Python asoslarini biluvchi;</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">- Aiogram;</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">- Database bilan ishlay oladigan;</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">- Djangoda web ilovalar yarata oladigan;</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">- APIlar bilan ishlay oladiga va albatta hamma uchun zarur bo&#39;lgan back-end mutaxasisi bo&#39;lib chiqasiz.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Soff Study o&#39;quv markazi kafolatlaydi:</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Umumiy imtihonlarda yuqori natija ko&#39;rsatgan o&#39;quvchilar ish bilan ta&#39;minlanishi;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Asosiy mentorlardan tashqari ikkinchi mentor ustoz biriktirilishi;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Darslar o&#39;z vaqtida bo&#39;lishi va video darslar tashlab berilishi;</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Back-end kursi strukturasi:</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">o&#39;quv kursimiz davomiyligi 6oy bo&#39;lib,quyidagi tartibda bo&#39;lib o&#39;tadi:</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">1.Ilk oydan Back-end olamiga qadam qo&#39;yasiz va boshlang&#39;ich bilimlarga ega bo&#39;lasiz.</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">2.Ushbu oyda siz PYTHON asoslarini chuqur o&#39;rganasiz.</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">3.Ushbu oy 2 qismga bo&#39;linadi ,1-qismda aiogram ,2-qismda esa Database bilan ishlash va querylar yozish o&#39;rganiladi.</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">4.Bu oyda Web sohasiga kiriladi va bu borada bilimlar berib o&#39;tiladi.</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">5.Ushbu oy Djangoda web ilovalar yaratish va serverlar yuklash o&#39;rgatiladi.</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">6.Vanihoyat so&#39;ngi oyda APIlar bilan ishlash,hamda serverga yuklash bilimlari beriladi.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#95a5a6">&nbsp; &nbsp; &nbsp;&nbsp;</span><img src="/media/uploads/2023/08/12/image-20230812162711-1.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>Soff Study o&rsquo;quv markazimizda quyidagi imkoniyatlarga ega bo&rsquo;lishingiz mumkin.</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">&bull; Darsdan tashqari 2-mentor ko&#39;magidan foydalanish</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">&bull; 6-oyda Ishga kirish uchun suhbatlarga tayyorlov. (Texnik intervyu)</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">&bull; Jamoa bilan ishlash qobiliyatini shakllantirish(Hackathon va musobaqalar orqali)</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">&bull; 0 dan start up ko&rsquo;tarish(Master klass va musobaqalar orqali)</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">&bull; Mijoz bilan gaplashish, doimiy mijozlarga ega bo&rsquo;lish ko&rsquo;nikmalariga ega bo&rsquo;lasiz.(Master klass va musobaqalar orqali)</span></h4>\r\n\r\n<h4><span style="color:#95a5a6">&bull; Ishga kirishda so&rsquo;raladigan portfolio uchun real loyiha(kurs davomida)</span></h4>\r\n\r\n<h4><span style="color:#95a5a6"><strong>To&#39;lov bo&#39;yicha markazimizda quyidagi chegirmalar mavjud ;</strong></span></h4>\r\n\r\n<h4><span style="color:#95a5a6">Kurslarga 1 ta do&rsquo;stingizni taklif qiling va 1 oy uchun 50% chegirmaga ega bo&rsquo;ling. 2 ta do&rsquo;stingizni taklif qiling va 1 oy uchun 70% chegirmaga ega bo&rsquo;ling. 3 ta do&rsquo;stingizni taklif qiling va 1 oy uchun 100% chegirmaga ega bo&rsquo;ling.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#ffffff"><img src="/media/uploads/2023/08/12/image-20230812143127-1.jpg" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style="color:#95a5a6"><strong>FAQ:</strong></span></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>1.Nega aynan shu kursda o&#39;qishim kerak?</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Bizda barcha bilimlar rea tajribalarga asoslangan.Mentorlarimiz esa sohada katta tajriba va yuzlab muvaffaqiyatli loyihalarga ega hisoblanadi.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>2.Kursni bitirgandan so&#39;ng ish topa olamanmi?</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Agarda siz kursni muvaffaqiyatli natijalar bilan yakunlasangiz,ish borasida hech qanday muammo bo&#39;lmaydi.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>3.Imtihonlar qay tartibda bo&#39;ladi?</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Kursimiz davomiyigi 6 oy va har yangi oyga o&#39;tish uchun nazorat imtihonlari bo&#39;lib o&#39;tadi. Agarda imtihonda kerakli ballni yig&#39;a olmasangiz siz bilan xayrlashishimizga to&#39;g&#39;ri keladi.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#95a5a6"><strong>4.Kursni yakunlagandan so&#39;ng qanday sertifikatga ega bo&#39;laman?</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#95a5a6">Yakuniy imtihonda kerakli natija ko&#39;rsatgan talabalar Soff Study tomonidan sertifikat bilan taqdirlanadi va yuqori natijaga ega bo&#39;lganlar esa Soff Hub jamoasiga olinishi mumkin.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#95a5a6">&nbsp; &nbsp; &nbsp; &nbsp;</span></p>\r\n\r\n<p><img src="/media/uploads/2023/08/11/image-20230811222616-1.jpg" style="height:378px; width:504px" /></p>\r\n\r\n<p>&nbsp;</p>	back-end-dasturlash-kurslari
