1	2023-07-25	2023-08-02	<h2><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="color:#ffffff">&nbsp;&nbsp;</span></strong><span style="color:#ffffff">&nbsp;<strong>Oferta</strong></span></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><span style="color:#ffffff"><strong>&nbsp;&nbsp;Zamonaviy kasblardan ta&rsquo;lim xizmatlarini taqdim etish bo&rsquo;yicha ommaviy offerta</strong></span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>1. Umumiy holatlar&nbsp;</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">1.1. O&rsquo;zbekiston Respublikasi aholi kodeksiga binoan ushbu hujjat &lt;&lt; Soff Study &gt;&gt; MCHJ ning (matn davomida &ndash; o&rsquo;quv markazi) har qanday jismoniy shaxsga (matn davomida - o&rsquo;quvchi) ushbu shartnomani unda kiritilgan shartlar asosida qabul qilishga qaratilgan rasmiy ommaviy taklif (oferta) hisoblanadi.</span></h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><span style="color:#ffffff">1.2. Bu oferta rasmiy hujjat hisoblanadi va quyidagi manzilda joylashgan filiallarda ko&rsquo;rsatilgan:</span></h5>\r\n\r\n<h5><span style="color:#ffffff">Toshkent shahri, Chilonzor tumani, Bunyodkor 8/1<br />\r\nToshkent shahri, Yunusobod tumani, Amir Temur shox ko&rsquo;chasi&nbsp; shuningdek soffstudy.uz manzili bo&rsquo;yicha global internet tarmog&rsquo;ida joylashtirilgan.</span></h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><span style="color:#ffffff">1.3. Ushbu taklifni to&rsquo;liq va shartsiz qabul qilish &ndash; bu ushbu Taklifda ko&rsquo;rsatilgan shartlarni bajarish uchun har qanday harakatlar, shu jumladan xizmatlar uchun to&rsquo;lov, o&rsquo;quv markazining soffstudy.uz veb-saytida o&rsquo;quvchi sifatida ro&rsquo;yxatdan o&rsquo;tish; o&rsquo;quv markaziga o&rsquo;zining shaxsiy ma&rsquo;lumotlarini taqdim etish (to&rsquo;liq ismi, telefon raqami, tug&rsquo;ulgan yili); shuningdek shaxsning o&rsquo;quv markazi xizmatlaridan foydalanish niyatini tasdiqlovchi boshqa harakatlari.</span></h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><span style="color:#ffffff">1.4. O&rsquo;zbekiston Respublikasi Fuqorolik Kodeksining 369 va 370 - moddalarining bir qismiga muvofiq, agar quyidagi keltirilgan shartlar qabul qilinsa va tegishli miqdor to&rsquo;lansa, ushbu Taklifni qabul qilgan shaxs ushbu taklifning Tomoniga aylanadi va bundan keyin O&rsquo;quvchi / Buyurtmachi deb yurilitadi.</span></h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h4><span style="color:#ffffff">2. Shartnoma predmeti</span></h4>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><span style="color:#ffffff">2.1. O&rsquo;quvchi / Buyurtmachi ko&rsquo;rsatma beradi va O&rsquo;quv Markazi / Bajaruvchi &lt;&lt; Soff Study &gt;&gt; MCHJ o&rsquo;quv markazida ushbu dastur bo&rsquo;yicha ta&rsquo;lim</span></h5>\r\n\r\n<h5><span style="color:#ffffff">xizmatlarini ko&rsquo;rsatish majburiyatini oladi: Dasturlash kurslari (matn davomida &ndash; &ldquo;Xizmatlari&rdquo;).</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">2.2. Agar xizmatdan foydalanuvchi o&rsquo;n ikki yoshdan o&rsquo;n sakkiz yoshgacha bo&rsquo;lgan voyaga yetmagan bo&rsquo;lsa, Mijoz ota-ona (farzand asrab oluvchi, vasiy) bo&rsquo;lishi mumkin.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">2.3. Xizmatlar haqiqiy ommaviy ofertada keltirilgan 1-ilovaga muvofiq taqdim etiladi</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">2.4. O&rsquo;quv markazi xizmatlarni haqiqiy ommaviy ofertaning 2-ilovasida keltirilgan amaldagi narxlar ro&rsquo;yxatiga muvofiq amalga oshiradi va o&rsquo;quvchi / buyurtmachi xizmatlar uchun to&rsquo;lovlarni ushbu ommaviy taklif sharatlariga muvofiq to&rsquo;laydi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>3. Tomonlarning huquqlari va vazifalari.</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1 O&rsquo;quv markazining huquq va vazifalari.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.1. O&rsquo;quv markazi ushbu ommaviy taklifning 2.1 bandida ko&rsquo;zda tutilgan xizmatlarni tashkil etish va ularning bajarilishini ta&rsquo;minlash majburiyatini oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.2. O&rsquo;quv markazi bir oy davomida 20 kishigacha bo&rsquo;lgan guruhda 180 daqiqa davomida 12 ta dars o&rsquo;tkazish majburiyatini oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.3. Har oylik darslarni tugatgandan so&rsquo;ng, O&rsquo;quv markazi Talabani sinovdan o&rsquo;tkazadi va imtihon natijalari asosida uni &lt;&lt; Dasturlash kurslarini o&rsquo;qitish qoidalariga&gt;&gt; muvofiq keyingi bosqichga o&rsquo;tkazadi / hozirgi darajasida qoldiradi / keyingi tahsilni berishni rad etadi va haqiqiy Ofertaning amalini bir tomonlama bekor qiladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.4. O&rsquo;quv markazi o&rsquo;quv to&rsquo;lovlarini o&rsquo;z vaqtida to&rsquo;lamagan o&rsquo;quvchining darslarda qatnashishini cheklash huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.5. O&rsquo;quv markazi o&rsquo;quvchining roziligisiz o&rsquo;qitish davrida o&rsquo;qituvchini almashtirish yoki almashtirmaslik huquqiga ega. Agar o&rsquo;quvchi talab qilsa ham.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.6. O&rsquo;quv markaz oylik imtihonidan o&rsquo;tmagan o&rsquo;quvchiga xizmat ko&rsquo;rsatishni to&rsquo;xtatib qo&rsquo;yishga, shuningdek, munosib guruhlar bo&rsquo;lmagan taqdirda, boshqa guruhga o&rsquo;tkazmaslikga haqli. O&rsquo;quv markazi ilgari to&rsquo;langan xizmat to&rsquo;lovini qaytarib bermaslik huquqini o&rsquo;zida saqlab qoladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.7. O&rsquo;quv markazi darslar soni / shakli yoki darslar jadvalini bir tomonlama o&rsquo;zgartirish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.8. Agar guruhda 5 yoki 6 dan kam talaba qolsa, O&rsquo;quv markazi guruhni yopib, o&rsquo;quvchilarni boshqa guruhlarga tarqatish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.9. O&rsquo;quvchi / Buyutmachi darslarni sababsiz / ogohlantirishlarsiz qoldirgan taqdirda, O&rsquo;quv markazi to&rsquo;langan pul mablag&rsquo;ini qaytarib bermaslik va yoki boshqa shaxsga o&rsquo;tkazmaslik huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.10. O&rsquo;quv markazi mustaqil ravishda o&rsquo;quv jarayoni / baholash tizimi / o&rsquo;quvchilar bilimini sinash shakllarini tanlash huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.11. O&rsquo;quvchi / Buyurtmachi ushbu oferta amal qilish muddatida oferta talablarini buzgan taqdirda, o&rsquo;quv markazi o&rsquo;quvchini darslardan chetlatish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.12. Agar o&rsquo;quvchi / buyurtmachi o&rsquo;qish davrida o&rsquo;quv markaz xodimlarini yoki boshqa o&rsquo;quvchi / buyurtmachini haqorat qilgan (hurmatsizlik qilgan) bo&rsquo;lsa, O&rsquo;quv markazi o&rsquo;quvchini darslardan chetlatish va markazga kirishini bekor qilish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.1.13. O&rsquo;quv markazi ushbu ofertaning shartlarini istalgan vaqtda bir tomonlama o&rsquo;zgartirish yoki to&rsquo;ldirish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>3.2. O&rsquo;quvchi / Buyurtmachining huquq va vazifalari</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.1 Talaba Shatnoma tuzilganiga qadar va to&rsquo;lovni to&rsquo;lashdan oldin haqiqiy Ofertaning mazmuni va shartlari bilan, soffstudy.uz veb-saytiga joylashtirilgan O&rsquo;quv markazi xizmatlarining narxi bilan tanishishi shart.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.2 Talaba / Buyurtmachi tomonidan dastlabki to&rsquo;lov amalga oshirilsa, Talaba / Buyurtmachi ushbu haqiqiy Ofertani o&rsquo;qib, qabul qilganligini bildiradi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.3 Talaba / Buyurtmachi har oyning uchinchi darsigacha o&rsquo;qish uchun to&rsquo;lovni amalga oshirish majburiyatini oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.4 Talaba / Buyurtmachi o&rsquo;qituvchi tomonidan o&rsquo;tkaziladigan darslarga tayyorgarlik jarayonida mustaqil topshiriqlarni bajarishi, tasdiqlangan jadval asosida darslarga qatnashishni, ushbu Oferta bo&rsquo;yicha o&rsquo;qish huquqini uchinchi shaxslarga o&rsquo;tkazmaslikni o&rsquo;z zimmasiga oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.5 Talaba / Buyurtmachi dars davomida taqdim etilgan materiallar va ma&rsquo;lumotlarni (qog&rsquo;oz, elektron yoki boshqa shaklda) tijorat yoki notijorat maqsadida tarqatmaslik (nusxalash, nashr etmaslik, Internet-resurslarida joylashtirmaslik, uchinchi shaxslarga o&rsquo;tkazmaslik yoki qayta sotmaslik ) va bu ma&rsquo;lumotlardan shaxsiy foydalanishdan boshqa yo&rsquo;l bilan foydalanmaslik majburiyatini oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.6 Talaba / Buyurtmachi guruh tarqatilishi sababli, boshqa guruhga o&rsquo;tish qarorini qabul qilsa, Talaba / Buyurtmachi to&rsquo;lovni amalga oshirib kursni davom ettirish majburiyatini o&rsquo;z zimmasiga oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.7 Talaba / Buyurtmachi &lt;&lt; Dasturlash kurslarida o&rsquo;qish qoidalari&gt;&gt;ga amal qilishi shart (2-ilova).</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.8 Talaba / Buyurtmachi O&rsquo;quv markazining o&rsquo;quv jarayoniga kirish imkoniyatini uchinchi shaxslarga o&rsquo;tkazmaslikni o&rsquo;z zimmasiga oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.9 Talaba / Buyurtmachi O&rsquo;quv markazning talabiga binoan O&rsquo;quv markazning mol-mulkiga yetkazgan zararni qoplashni o&rsquo;z zimmasiga oladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.10 Talaba / Buyurtmachiga O&rsquo;quv markaz hududida baqirish, baland ovozda musiqa tinglash, shovqin qilish, chekish taqiqlanadi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.11 Talaba / Buyurtmachi O&rsquo;quv markazning darslari davomida o&rsquo;quv jarayonini amalga oshirish uchun zarur bo&rsquo;lgan mol-mulkidan foydalanish huqiqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.12 Talaba / Buyurtmachi o&rsquo;quv jarayoni bilan bog&rsquo;liq masalalar bo&rsquo;yicha O&rsquo;quv markazi xodimlariga murojaat qilish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">3.2.13 Talaba / Buyurtmachi bilim, qobiliyat, o&rsquo;zlashtirish darajalari va ushbu ko&rsquo;rsatkichlarni baholash mezonlari tog&rsquo;risida to&rsquo;liq va ishonchli ma&rsquo;lumotlarni olish huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;4. Xizmat narxi va hisob-kitob qilish tartibi.</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.1 Xizmatlar narxi 1-ilovada O&rsquo;zbekiston Respublikasi so&rsquo;mida ko&rsquo;rsatilgan.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.2 Ushbu Oferta bo&rsquo;yicha to&rsquo;lov Talaba / Buyurtmachi tomonidan birinchi sinov darsidan so&rsquo;ng quyidagi tartibda amalga oshiriladi: O&rsquo;qitishning birinchi oyi uchun 100% miqdorida oldindan avans to&rsquo;lovi sifatida birinchi darsdan so&rsquo;ng amalga</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">oshirilishi kerak. Keyingi oyda esa (12 darsdan so&rsquo;ng), yangi oy uchun uchinchi darsga qadar to&rsquo;lov amalga oshiriladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.3 Agar to&rsquo;lov o&rsquo;z vaqtida amalga oshirilmasa, O&rsquo;quv Markazi Talaba / Buyurtmachini darslarga kiritmaslik va shaxsiy kabinetga kiritlmaslik huquqiga ega.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.4 Talaba / Buyurtmachi o&rsquo;tkazib yuborgan darslari uchun to&rsquo;lov qaytarilmaydi, o&rsquo;qish vaqti qoplanmaydi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.5 Talaba / Buyurtmachi kurslar oldidan Xizmatlarni rad etgan taqdirda, mijoz Xizmatlar uchun qilgan to&rsquo;lov qaytariladi. Talaba / Buyurtmachi kamida bitta darsda qatnashgan bo&rsquo;lsa, xizmatlar uchun to&rsquo;langan pul qaytarilmaydi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">4.6 Xizmatlar uchun to&rsquo;lov naqd va naqd pulsiz (bank kartasidan / pul o&rsquo;tkazmalaridan) amalga oshirilishi mumkin. Naqd pulsiz to&rsquo;lovda, to&rsquo;lovni tasdiqlovchi tegishli hujjatlar, to&rsquo;lovni amalga oshirgan kundan boshlab bir xafta ichida Talaba / Buyurtmachi tomonidan taqdim etilishi kerak.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>5. Umumiy tartiblar</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">5.1 Dars kunlari O&rsquo;zbekiston Respublikasida nishonlanadigan bayramlarga tog&rsquo;ri kelgan taqdirda hamda binoga kirish cheklangan taqdirda, darslar bekor qilinadi va boshqa kunga o&rsquo;tkaziladi. Boshqa kunga o&rsquo;tkazilgan darslarda qatnashmagan o&rsquo;quvchilar uchun to&rsquo;lov qaytarilmaydi va yoki keyingi oyga o&rsquo;tkazilmaydi</span></h5>\r\n\r\n<h5><span style="color:#ffffff">.</span></h5>\r\n\r\n<h5><span style="color:#ffffff">5.2 Agar Talaba / Buyurtmachi ma&rsquo;lum darslarni qoldirib, o&rsquo;qishni davom ettirmoqchi bo&rsquo;lsa, 12 ta dars uchun to&rsquo;liq summa undiriladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">5.3 Agar Talaba / Buyurtmachi muddati tugagunga qadar O&rsquo;quv Markazni tark etish haqida Xizmat ko&rsquo;rsatish bo&rsquo;limini (adminstratsiya) yozma ravishda ogohlantirmagan bo&rsquo;lsa, to&rsquo;lov 12 ta dars uchun to&rsquo;liq undiriladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">5.4 Agar imtihon muvzaffaqiyatsiz yakunlansa va tegishli guruhlar O&rsquo;quv Markazida topilmasa, to&rsquo;langan summa keyingi oyga o&rsquo;tkazilmaydi va qaytarilmaydi va Talaba / Buyurtmachi keyingi oy boshlanguncha guruhda o&rsquo;qib turishi shart.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;6. Fors-Major</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">6.1 Tomonlar ushbu Shartnoma bo&rsquo;yicha majburiyatlarni qisman yoki to&rsquo;liq bajarmaganliklari uchun javobgarlikdan ozod qilinadi, agar bu fors-major holatlari natijasida yuzaga kelgan bo&rsquo;lsa, masalan: yong&rsquo;inlar, zilzilalar, harbiy harakatlar va boshqalar, agar ushbu holatlar ushbu Shartnomani amalga oshirishga bevosita ta&rsquo;sir ko&rsquo;rsatgan bo&rsquo;lsa.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">7. Taklif Shartnomasining muddati va ko&rsquo;rsatilgan xizmatlarni yetkazib berish va qabul qilish tartibi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">7.1 Shartnoma tuzilgan (taklifni qabul qilgan) paytdan boshlab kuchga kiradi va Tomonlar o&rsquo;z majburiyatlarini bajarmaguncha amal qiladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">7.2 Ushbu Ommaviy Oferta yuqorida sanab o&rsquo;tilgan maqsadlar uchun cheklovlarsiz tuzilgan.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">7.3 Oferta shartnomasi bekor qilingandan so&rsquo;ng, tomonlar tomonidan shartnomani bekor qilish tog&rsquo;risidagi dalolatnoma tuzilmaydi yoki imzolanmaydi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">7.4 Ushbu Ommaviy Ofertani bajarish paytida yuzaga kelishi mumkin bo&rsquo;lgan barcha kelishmovchiliklar va nizolar Tomonlar o&rsquo;rtasida muzokara yo&rsquo;li bilan hal etiladi. Agar ular muzokara yo&rsquo;li bilan bartaraf etilmasa, ular O&rsquo;zbekiston Respublikasining amaldagi qonunchiligiga muvofiq yakuniy hal qilinishi kerak.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>8. Rekvizitlar</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">MCHJ &lt;&lt; Soff Study&gt;&gt; - 13.04.2022 yilda berilgan 1124275 raqamli ro&rsquo;yxatdan o&rsquo;tganligi asosida ta&rsquo;lim ximatlarini ko&rsquo;rsatuvchi yuridik shaxs<br />\r\nYuridik manzil: Toshkent shahri, Chilonzor tumani, Toshkent sh, Chilonzor,  mavze, 50 uy, 46 kv</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">INN: 309 460 545<br />\r\nTel: 90 002 67 89<br />\r\nDirektor: Abdurahmonov Z.A</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>Ilova 1</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">Kurs nomi</span></h5>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">O&rsquo;quvchilar soni</span></h5>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">Oylik darslar soni</span></h5>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">1 ta dars uchun to&rsquo;lov narxi (so&rsquo;m)</span></h5>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">Bir oylik o&rsquo;qish narxi (so&rsquo;m)</span></h5>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<h5><span style="color:#ffffff">Front-End<