fff"><strong>&lt;&lt;Soff Study&gt;&gt; MCHJ&rsquo;ning mavjud kurslarida o&rsquo;qish qoidalari </strong></span></h4>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>Yo&rsquo;nalish tanlash:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Talaba / Buyurtmachi O&rsquo;quv markazga kelib, suhbat asosida yoki sinov darslarida qatnashgan holda yo&rsquo;nalish tanlashi kerak. Sinov darsdan so&rsquo;ng, asosiy darslar boshlanadi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp; Keyingi bosqichga o&rsquo;tish:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Har oyda Talaba / Buyurtmachi Ijrochi tomonidan tashkil etilgan oylik imtihonni topshiradi va 65 balldan yuqori ball to&rsquo;plashi kerak. Agar Talaba / Buyurtmachi kerakli miqdordagi ballni to&rsquo;play olmasa, Talaba / Buyurtmachiga 1 xafta muddatda qayta topshirish uchun sinov vaqti beriladi. Talaba / Buyurtmachi 1 xaftadan so&rsquo;ng, qayta imtihon topshirishi va 65 balldan yuqori ball to&rsquo;plashi kerak. Agar Talaba / Buyurtmachi yana zarur ball to&rsquo;play olmasa 1 oy qayta o&rsquo;qishi yoki kursni to&rsquo;xtatishi mumkin bo&rsquo;ladi. Agar Talaba / Buyurtmachi belgilangan kunda imtihonga sababsiz kelmasa, Bajaruvchi o&rsquo;z xohishiga ko&rsquo;ra, u uchun qayta imtihon o&rsquo;tkazishga yoki imtihonni o&rsquo;tkazishni rad etishga haqlidir.</span></h5>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;Guruhlar / o&rsquo;qituvchilarning o&rsquo;zgarishi:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Agar guruh darajasi Talaba / Buyurtmachiga mos kelmagan taqdirda, yoki guruh vaqti Talaba / Buyurtmachiga mos kelmagan taqdirda, bajaruvchi javobgarligi asosida guruhni o&rsquo;zgartirishga haqli.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;Darslarni o&rsquo;tkazib yuborish:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Agar Talaba / Buyurtmachi belgilangan vaqtda darsga kelmasa, O&rsquo;quv markaz darsni Talaba / Buyurtmachisiz boshlash huquqiga ega. Agar Talaba / Buyurtmachi belgilangan vaqtda kelmagan bo&rsquo;lsa, Talaba / Buyurtmachining aybi bilan dars qoldirilgan hisoblanadi va qoldirilgan dars uchun pul Talaba / Buyurtmachining balansidan yechiladi.</span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;Pul mablag&rsquo;larini qaytarish:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Talaba / Buyurtmachi tomonidan to&rsquo;langan pul mablag&rsquo;larini qaytarish va muzlatish hech qanday shartlarda amalga oshirilmaydi.</span></h5>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;Ota-onalar bilan aloqa:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Voyaga yetmagan har bir talaba o&rsquo;z ota-onalari yoki ularning vasiylari tog&rsquo;risida ma&rsquo;lumot berishlari shart. Darslarga borish, to&rsquo;lov to&rsquo;lash va imtihonlar tog&rsquo;risidagi har qanday savol Bajaruvchi tomonidan voyaga yetmagan talabalarning ota-onalariga yuboriladi.</span></h5>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;</strong></span></h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>Yosh cheklovlari:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Bajaruvchining xizmatlarini ko&rsquo;rsatadigan eng kam yoshi o&rsquo;n ikki yoshda.</span></h5>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff"><strong>&nbsp;Qo&rsquo;shimcha materillar:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">Talaba / Buyurtmachi kursni to&rsquo;lagandan so&rsquo;ng, har bir Talaba / Buyurtmachi har bir darajaga tegishli kerakli o&rsquo;quv materillari hamda video darsliklarni olishga haqli.</span></h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h4><span style="color:#ffffff"><strong>O&rsquo;quv markazida o&rsquo;zini tutish:</strong></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="color:#ffffff">&ndash; Talaba / Buyurtmachga xodimlar uchun ofis maydoniga kirish taqiqlanadi.</span></h5>\r\n\r\n<h5><span style="color:#ffffff">&ndash; Talaba / Buyurtmachi O&rsquo;quv markazi hududida joylashgan hojatxonalarda tozalik va tartibni saqlashga majbur.</span></h5>\r\n\r\n<h5><span style="color:#ffffff">&ndash; Talaba / Buyurtmachi O&rsquo;quv markazning mulkiga yaxshi g&rsquo;amxo&rsquo;rlik qilishi shart.</span></h5>
