2	2023-08-07	2023-08-29	HTML semantic elementlar haqida!	posts/posts/photo_2023-01-24_20-32-30.jpg	2	<h4><span style="color:#ffffff">HTML semantic elementlar web sahifasidagi kontentni tashkil qilish yoki stilini belgilashdan tashqari ma&#39;no yoki maqsadga ega bo&#39;lgan ma&#39;lum HTML teglaridir. Bu elementlar web sahifadagi kontentga semantik ma&#39;no beradi, uning o&#39;qilishi va tushuntirilishi odamlar va mashinalar uchun osonlashtiradi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">Eng ko&#39;p ishlatiladigan HTML semantic elementlar quyidagilardir:</span></h4>\r\n\r\n<h4><span style="color:#ffffff">1. &lt;header&gt; - web sahifasining yoki web sahifasi bo&#39;limining sarlavhasini ifodalaydi.<br />\r\n2. &lt;nav&gt; - web sahifasining navigatsiya havolalarini ifodalaydi.<br />\r\n3. &lt;main&gt; - web sahifasining asosiy kontentini ifodalaydi.<br />\r\n4. &lt;article&gt; - o&#39;ziga xos tarkib qismi bo&#39;lgan kontentni ifodalaydi.<br />\r\n5. &lt;section&gt; - web sahifasining bir qismi ifodalaydi.<br />\r\n6. &lt;aside&gt; - asosiy kontentga oid, lekin uni tushunish uchun zaruri bo&#39;lmagan kontentni ifodalaydi.<br />\r\n7. &lt;footer&gt; - web sahifasining yoki web sahifasi bo&#39;limining pastki qismini ifodalaydi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">HTML semantic elementlardan foydalanish web sahifasining osonligi va foydalanish qobiliyatini yanada yaxshilaydi, shuningdek, uning qidiruv optimizatsiyasini (SEO) ham yaxshilaydi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">Malumot foydali bo&#39;lgan bo&#39;lsa Kanalga A&#39;zo bo&#39;lib olamiz! &nbsp;</span></h4>\r\n\r\n<h4><span style="color:#ffffff">https://t.me/+M07j3M8CBfo3ODMy</span></h4>	2	html-semantic-elementlar-haqida
3	2023-08-07	2023-08-29	HTML Attributes	posts/posts/photo_2023-01-24_20-32-30_eAH77zJ.jpg	3	<h4><span style="color:#ffffff">HTML Attributes&nbsp;</span></h4>\r\n\r\n<h4><span style="color:#ffffff">HTML teglari bilan birga ishlatiladigan yorliqlardir, ular HTML teglari bilan birga ishlatiladigan qo&#39;shimcha ma&#39;lumotlarni ifodalaydi. HTML attributlari teglar bilan ishlatiladigan kalitlarni (key-value pairs) ifodalaydi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">Misol uchun, &lt;a&gt; tegi orqali havolalar (links) yaratish uchun href &nbsp;attributidan foydalaniladi. Misol:</span></h4>\r\n\r\n<h4><span style="color:#ffffff">html:</span></h4>\r\n\r\n<h4><span style="color:#ffffff">&lt;a href=&quot;https://www.example.com&quot;&gt;Misol havolasi&lt;/a&gt;</span></h4>\r\n\r\n<h4><span style="color:#ffffff">Bu yerda href attributi https://www.example.com manbasiga havolani bildiradi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">Boshqa HTML atributlaridan ba&#39;zi ko&#39;p ishlatiladiganlar quyidagilardir:</span></h4>\r\n\r\n<h4><span style="color:#ffffff">class - HTML elementini stil bilan bog&#39;lash uchun ishlatiladi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">id - HTML elementi bilan bog&#39;liq ma&#39;lumotlarni tanlash uchun ishlatiladi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">src - rasmlarni yuklash uchun manba bilan bog&#39;lash uchun ishlatiladi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">alt - rasmlarni ta&#39;riflash uchun ishlatiladi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">title - HTML elementining sarlavhasini aniqlash uchun ishlatiladi.</span></h4>\r\n\r\n<h4><span style="color:#ffffff">HTML atributlari keng tarqalgan va ulardan foydalanish HTML-da ishni osonlashtiradi va ko&#39;proq mukammal ko&#39;rinishda ko&#39;rsatishni osonlashtiradi.</span></h4>	2	html-attributes
1	2023-07-25	2023-08-29	Bilib oling:  (Dasturchi bo'lmoqchimisiz?)	posts/posts/photo_2023-04-14_22-07-39.jpg	1	<h5><span style="color:#ffffff">- lanch bo&#39;lish kerak emas.<br />\r\n- shustriy bo&#39;ling.<br />\r\n- hammasi o&#39;z vaqtida bo&#39;lishi shart.<br />\r\n- intizomingizga jiddiy qarang.<br />\r\n- nima qilayotganingizni konkretna bilib qiling, bita joyda aylanib yuravermasdan. 4-8 soatlar bitta joyda galdiranglab yurgandan ko&#39;ra 15 minut oddiygini funksiyani qanday ishlayotganini tahlil qilganingiz million marta afzal.<br />\r\n- ko&#39;proq amaliyot qilish kerak. Amaliyotni ham tushunib qilish kerak (lyuboy videodan ko&#39;rib bir xil kod yozib ketavermasdan, ozgina to&#39;xtab tahlil qiling o&#39;zi nima yozganingizni)<br />\r\n- 200 ta tugallanmagan lekin turli xil stacklarni ishlatgan loyihalaringizni bari shunchaki bir tin. Undan ko&#39;ra oddiy html, css da to&#39;liq bir Pixel Perfect da qilingan Landing sahifa yaxshi.&nbsp;<br />\r\n- qo&#39;ylanib ko&#39;pam chalg&#39;imasdan konkretna o&#39;zingiz yoki ustozingiz chizib bergan yo&#39;l bo&#39;ylab keting.&nbsp;<br />\r\n- sal mindey soft skill laringiz ustida ham ishlang. Mindey bir gapirish, tushuntirish, muamoni anglab olish, o&#39;zizni tutish qobilyalatlaringiz yoq. Ichizda gapirmasdan tashqarida gapiring mindey bir balandroq, eshitaylik biz ham, bir yechim berardik.<br />\r\n- har bir oddiy narsani so&#39;rayvermay ozgincha o&#39;ziz ham izlaning. Kompyuteringiz bilan dunyoni barcha ma&#39;lumotlariga ega bo&#39;lasiz, Lyuboy soha bo&#39;yicha ma&#39;lumotlar tiqilib yotibdi. Sun&#39;iy intelektlarni aytmasa ham bo&#39;ladi.<br />\r\n- turli xil motivatsiyalarga berilavermang, hammasi yolg&#39;on.<br />\r\n- siz kuchli depressiya, siqilish, demotivatsiya, sog&#39;likni yo&#39;qolishlari, yaqinlaringiz bilan kop vaqt bo&#39;la olmaslik va boshqa narsalar yo&#39;qotish sizni kutib turibdi. Bularni hali hech nima emas... davom etsam kop.<br />\r\n- shunday holatlarga tayyor bo&#39;lsangizgina davom eting. IT sohasida ko&#39;proq o&#39;rtoqlar ortiring, hech qanday tadbirlarni qoldirmeng, faqat kod yozib yuravermasdan.<br />\r\n- maqsad katta pul topishmi, boshqa nima bo&#39;lsa ham, siz prosta tak o&#39;ylab o&#39;tiravermasdan katta sababini qiling! Sababini qilish bu shungachki qoldirmasdan ketma ket to&#39;plab borayotgan ilmlaringiz boladi. O&#39;tiravermang komyuterni ovolib takoy, men dasturchiman v.klar deb.&nbsp;<br />\r\n- eeexx o&#39;qimislarmiyee, shuncha sharoitilaringiz bor. Nolishga vopshem haqillaringiz yo&#39;q.&nbsp;<br />\r\n- kompyuteri yo&#39;q, jaydari, qishloqdan kelgan o&#39;rtoqlarimiz, hozir butun korxonani Project Manageri bo&#39;lib IT loyihalarni boshqaradi. Siz esa hali ham IELTSim bor ulgimayapman, sesiya kelib qoldi, kasal bo&#39;lib qoldim, isitmam chiqyapti, boshim og&#39;riyapti, darsga bora olmayaman, vaqtim bo&#39;lmadi deb yuribsiz.<br />\r\n- vaqtingiz yo&#39;qmi suring, nima qilasiz jiddiy kirishmasangiz, sizga kim jiddiy qaraydi. Shu uchun ham siz kelajangizni ko&#39;ra olmay o&#39;tiraverasiz &quot;Men ham dasturchi bo&#39;la olamanmi? Ish topa olamanmi?&quot; v.k deb.<br />\r\n- sizlarni o&#39;rnilaringizda bo&#39;lganimda, maqsadim jiddiymi, tamom hech kim va hech narsa meni chalg&#39;itishiga yo&#39;l qo&#39;yib bermasdim.<br />\r\n- eeex bollar o&#39;qinglar sharoitdan foydalaninglar! Oldin ham, hozir ham, keyin ham, faqat Raqamli texnalogiyalar davri bo&#39;ladi. Biz bu bo&#39;yicha eng zo&#39;r kadr, mutahasis va startup asoschilar bo&#39;lishimiz kerak.&nbsp;</span></h5>\r\n\r\n<h5><span style="color:#ffffff">p.s: Ichimdagi dardlarim holatlarni ko&#39;rib, joyida bir yozib qo&#39;yay, kimdirga foydali bo&#39;lar dedimda. Ayniqsa endi o&#39;rganuvchi va ishga kirishga tayyorgalik ko&#39;rayotganlar uchun.</span></h5>	1	bilib-oling-dasturchi-bolmoqchimisiz
