4	2023-08-12	2023-08-29	Oxirgi intervyuda tushgan savollar haqida	posts/posts/posts/photo_2021-09-15_13-32-17.jpg	4	<h4><span style="color:#ecf0f1">Bu intervievda junior+/middle Javascript/Reactjs level bo&#39;yicha bo&#39;ldi. Bir qancha qiziq savollar bo&#39;ldi ,ammo qiyin savol bo&#39;lmadi)). Xo&#39;sh boshladik bo&#39;lmasa, birinchi qism har doimgidek Javascript bo&#39;yicha savollar berildi bunda birinchi savol&nbsp;<strong>Promise</strong>-nima? degan savoldan boshlandi hamda suhbat juda qizg&#39;in bo&#39;ldi, undan keyin shu javascript bo&#39;yicha savollar tushdi va topshiriq berishdi albatta ularni copy qilib olishga ulgurdim hamda ulashishni xohladim. Qani boshladik unda:</span></h4>\r\n\r\n<p><img src="/media/uploads/2023/08/12/image-20230812152633-2.jpg" style="height:518px; width:522px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><img src="/media/uploads/2023/08/12/image-20230812152813-4.jpg" style="height:184px; width:518px" /></h4>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ecf0f1">Shu savollar berildi bularning ichida eng qiziq topshiriq men uchun oxirgisi hamda&nbsp;<strong>// return sum of the collection</strong>&nbsp;bunisi bo&#39;ldi.Bularning ikkalasini javobini yozib qo&#39;yaveraman qolganlari juda oson.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="/media/uploads/2023/08/12/image-20230812152913-5.jpg" style="height:462px; width:603px" /></p>\r\n\r\n<p><img src="/media/uploads/2023/08/12/image-20230812153034-6.jpg" style="height:405px; width:601px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>	3	oxirgi-intervyuda-tushgan-savollar-haqida
7	2023-08-21	2023-08-29	Job intervyularda tushgan yana bir qiziq savol	posts/posts/posts/photo_2023-01-24_20-32-30_6Dxw7yT.jpg	4	<h4><span style="color:#000000">Intervyularda tushgan savollardan yana bittasi juda e&#39;tiborimni tortgan bu adashmasam oxirgi intervyuda tushgan edi. Bolgariya kompaniyasi tomonidan bunda ham odatdagidek birinchi qism teoriya so&rsquo;ralgan keyin esa misol berilgan. Intervyularda teoriyani nega so&rsquo;rashar ekan deb juda boshim qotar edi . Ish tajribam oshgandan so&rsquo;ng bu nega so&rsquo;ralishini ancha tushinib yetdim, teoriyani yaxshi tushungan odam yaxshi kod yozar ekan, ya&#39;ni u biladi nimani ishlatish to&rsquo;g&rsquo;riligini. Shunchaki kod ishlasa bo&rsquo;ldi deb kod yozmaydi ,shuning uchun hozirgi bo&rsquo;lajak dasturchilarga maslahatim javascript bo&rsquo;lsin yoki boshqa texnologiya bo&rsquo;lsin kitob o&rsquo;qinglar teoriyalarni mag&rsquo;zini chaqinglar! Har doim intervyularda shunga ahamiyat berish kerakki, berilgan savol yoki misolga darrovgina bilar bilmas javob berish kerak emas hayajonlanib, birinchi o&rsquo;ylab olib chiroyli javob berish kerak! Endi tepadagi intervyuga keladigan bo&rsquo;lsak bu intervyu menga juda ko&rsquo;p narsa bergan edi shundagi bitta misol juda mazza qildirgan edi .Bu misol shundan iboratki ,obyekt ichida arraylar ichida array bor shularni yig&rsquo;indisini topish edi.<br />\r\nconst obj = {&nbsp;<br />\r\n&nbsp; ab: [1, 2, 3, 4],&nbsp;<br />\r\n&nbsp; cd: 4,&nbsp;<br />\r\n&nbsp; ef: [1, 2, [3, 4, 10]],&nbsp;<br />\r\n&nbsp; gh: [8, 3, [4, 8,[1, 1, 5], 10]],&nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp; z122425: 123,&nbsp;<br />\r\n};</span></h4>\r\n\r\n<h4><span style="color:#000000">bu misolda mani hayolimga kelgan narsa shu bo&rsquo;ldi yani hammasini bitta massivga o&rsquo;rab olish, ya&#39;ni arrayga. Bunda menga Object.value() metodi kerak bo&rsquo;ldi . Keyingi ishim massiv ichidagi massivlarni bitta massiv ko&rsquo;rinishiga olib kelib olish edi . Bunda menga flat() metodi kerak edi va so&rsquo;ngi bosqich yig&rsquo;indisini topish edi . Bunda manga reduce() metodi kerak edi, hamma bilgan hamma mashhur metod buni man pastda ko&rsquo;rsatib beraman:<br />\r\nconst obj = {<br />\r\n&nbsp; ab: [1, 2, 3, 4],<br />\r\n&nbsp; cd: 4,<br />\r\n&nbsp; ef: [1, 2, [3, 4, 10]],<br />\r\n&nbsp; gh: [8, 3, [4, 8, [1, 1, 5], 10]],</span></h4>\r\n\r\n<h4><span style="color:#000000">&nbsp; z122425: 123,<br />\r\n}</span></h4>\r\n\r\n<h4><br />\r\n<span style="color:#000000">const second = Object.values(obj)</span></h4>\r\n\r\n<h4><span style="color:#000000">const flatMethod = second.flat(4)</span></h4>\r\n\r\n<h4><span style="color:#000000">const sumWithInitial = flatMethod.reduce((accumulator, currentValue) =&gt; accumulator + currentValue, 0);</span></h4>	3	job-intervyularda-tushgan-yana-bir-qiziq-savol
8	2023-08-23	2023-08-29	Kopchilikni qiynaydigan savolga javob topamiz!!!	posts/posts/posts/photo_2023-01-24_20-32-30_eTKWkga.jpg	4	<p><img src="/media/uploads/2023/08/23/image-20230823195324-1.jpg" style="height:213px; width:600px" /></p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#ffffff">var variable ga block scope ta&#39;sir qilmaydi. Shu sababli ko&#39;rinmasada for loopni ichida var bilan ochilgan variable global variable bo&#39;ladi. For loop har safar iteratsiya bo&#39;lganda var variable ga qiymatni saqlab, keyin yana iteratsiya bo&#39;ladi to for loopni ichidagi var i 3 marta qayta &nbsp;3 ga teng bo&#39;lmaguncha. &nbsp;Buning sababi scope chain va event loop sababli. Var variable global scope da turgani uchun har safar iteratsiya bo&#39;lganda var qabul qilgan avvalgi qiymatlar override bo&#39;lib, yangi qiymatni var i o&#39;zlashtirib oladi va bu jarayon var i 3 ga teng bo&#39;lmaguncha takrorlanadi. var i 3 ga teng bo&#39;lgandan keyin esa foor loop iteratsiyani to&#39;xtatadi va keyin setTimeoutni ichidagi console.log ishlaydi. Console.log 3 marotaba 3 ni chiqaradi. Bu event loop hodisasi tufayli sodir bo&#39;ladi.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="/media/uploads/2023/08/23/image-20230823195547-2.jpg" style="height:154px; width:600px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#ffffff">let variable ga block scope ta&#39;sir qiladi. Shu sababli &nbsp;for loopni ichida let bilan ochilgan variable block scoped variable bo&#39;ladi. Bu variable (let i) block scope dan tashqarida ishlamaydi. For loop har safar iteratsiya bo&#39;lganda let variable ga qiymatni saqlab, keyin yana iteratsiya bo&#39;ladi to for loopni ichidagi var i 3 marta qayta &nbsp;3 ga teng bo&#39;lmaguncha. Bunda let i foor loopni ichidagi block scope variable bo&#39;lgani uchun let i har safar qaytadan yaratiladi 3 marotaba va har safar yangi yaratilgan let i variable lari har safar boshqa boshqa qiymat qabul qiladi. Sababi let i block scope variable. Birinchi iteratsiyadi let i 0 ga teng, ikkichi iteratsiyadi 1 ga teng va bu holat let i 3 dan kichik eng oxirgi son (2) ga teng bo&#39;lmaguncha davom etadi. For loop iteratsiyasi butunlay to&#39;xtagandan so&#39;ng setTimeout ishlaydi va consol.log da har bir let i o&#39;zgaruvchisi o&#39;ziga tegishli qiymat bilan chiqadi. Birinchi let i 0 ga teng, ikkichisi 1 ga teng va uchunchi let i 2 ga teng bo&#39;ladi.</span></h4>	5	kopchilikni-qiynaydigan-savolga-javob-topamiz
6	2023-08-18	2023-08-29	Outsource IT kompaniyada ishlash	posts/posts/posts/posts/photo_2021-09-15_13-32-17_UUJx1zL.jpg	6	<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Outsource IT kompaniyada ishlashning foydali va zararli taraflari.</span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;Outsource IT kompaniyalar bular buyurtmachining dasturiy ta&rsquo;minotini qisqa muddatda va kam harajatlilik va sifatni ta&rsquo;minlagan holda tez loyihani topshirishga qaratilgan kompaniyalar outsource kompaniya deb ataladi.&nbsp;</span></h4>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;Keling endi &nbsp;tezlikka va sifatga urg&rsquo;u beradigan bunday kompaniyada stajor yo&rsquo;ki junior dasturchi bo&rsquo;lib ishlaydiganlar uchun foydali taraflarini ko&rsquo;rib chiqamiz. Boshqa kompaniya va tashkilotlarda faqat bitta loyiha ustida ishlaydigan dasturchilarga nisbatan tezroq o&rsquo;sishga erishasiz, chunki outsource kompaniyada bir kunda bir nechta loyihada ishlashga to&rsquo;g&rsquo;ri kelishi mumkin va asosan bunday hollarda siz yonayotgan(deadline yaqinlashgan yo&rsquo;ki o&rsquo;tib ketgan) loyihada ishlashingizga to&rsquo;gri keladi va bunday holda sizdan juda tez o&rsquo;ylash va qaror qabul qilish talab etiladi va buning natijasida o&rsquo;zingiz qila olmayman deydigan tasklarni qanday qilib tez bajarib qo&rsquo;yganingizni bilmay ham qolasiz, aytganimdek bitta loyihada ishlaydigan &nbsp;dasturchining 1 yilda oladigan tajribasini siz outsource kompaniyada ishlash orqali taxminan 3-4 oyda ortig&rsquo;i bilan olishga erishasiz va problem solving darajangiz ham nisbatan yuqori bo&rsquo;ladi.</span></h4>\r\n\r\n<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;</span></h4>\r\n\r\n<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;Endi salbiy taraflari haqida gapiradigan bo&rsquo;lsak, real loyihada ishlash, jamoa bo&rsquo;lib ishlash kabi narsalarni bilmaydigan dasturchi va githubda faqat &nbsp;git pull va git push dan boshqa narsa qilib ko&rsquo;rmagan dasturchiga outsource kompaniyada ish boshlashda yaxshigina qiyinchiliklarga duch keladi, &nbsp;ko&rsquo;pchilik bunday joyda ishlashga qiynalishadi va asosan 1 hafta yo`ki uzog&rsquo;i bir oy yurmasdan bunday joylardan ketishadi yo`ki ketkazishadi. Chunki ko&rsquo;pchilikka birinchi kelganida real loyihalar berishadi va asosan o&rsquo;zlari internet orqali yechim topishlari talab qilinadi, lekin o&rsquo;quv markazida mentorning ko&rsquo;magisiz ishlab ko&rsquo;rmagan yo&rsquo;ki hali tayinli googleda o&rsquo;zining bug (koddagi xatolik) lariga yechim topa olmaydigan odam uchun bir muncha &nbsp;qiyinchiliklarga olib keladi, albatta bunday kompaniyalarda yuklamalar ko&rsquo;pligi, tasklarni bajarish uchun qolib ham ishlashga to&rsquo;g&rsquo;ri kelishi mumkin va ko&rsquo;pchilikda bu stresga sabab bo&rsquo;lishi mumkin va albatta buning natijasida &ldquo;Burnout&rdquo; ya&rsquo;ni kod yozishdan charchash, &nbsp;shu kun kod yozmasam bo&rsquo;ldi deydigan holatga kelib qolish va o&rsquo;zingizni boshqa narsalarga chalg&rsquo;itishga urunish.&nbsp;</span></h4>\r\n\r\n<h4><span style="color:#dddddd">&nbsp;&nbsp;&nbsp;&nbsp;Tepadagilarni o&rsquo;qib endi dasturlashni boshlamoqchi bo&rsquo;lganlar yo&rsquo;ki endi o&rsquo;qishni tugatganlarda men bunga tayyormikanman yo&rsquo;ki bunday joyda ishlay olamanmikan degan savol paydo bo&rsquo;lishi mumkin, mening maslahatim birinchi ta&rsquo;surot eng muhimi shuning uchun ham sizdan hech bo&rsquo;lmasa 1-2 ta pet project, git(github) bilan ishlashdagi yaxshi ko&rsquo;nikma va albatta ko&rsquo;proq problem solving darajangizni oshirib kirishni tavsiya beraman va siz bu ko&rsquo;nikmalar bilan tezroq jamoaga moslashib keta olasiz.</span></h4>	4	outsource-it-kompaniyada-ishlash
